  useEffect(() => {
    setFormData(data);
  }, [data]);

  const handleSubmit = (e) => {
    e.preventDefault();
    // Aquí puedes enviar los datos a la API
  };

  return (
    <div>
      <form>
      <input name="name" type="text" value={formData.name} />
        <input name="email" type="text" value={formData.email} />
        <input name="phone" type="text" value={formData.phone} />
        <input name="website" type="text" value={formData.website} />
      </form>
    </div>
  );
};

export default Form;
